import React from 'react';
import {Route , Switch} from 'react-router-dom';
import Contact from './Contact';
import About from './About';
import Service from './Service';
import Menu from './Menu';

const App = () =>{
    return (
     <>
     <Menu />
      <Switch>
          <Route />
          <Route />
          <Route component={Error}/>
      </Switch>
    </>
    );

}

export default App;
